import { StyleSheet } from "react-native";

const StyleEditCenter = StyleSheet.create({
    
    conteiner:{
        display:"flex",
        alignItems:'center',
        width:'100%'
    },
    
    avatar:{
        height:100,
        width:100,
        borderRadius:100000000,
        marginTop:'3%'
    },

    editPhotoButt:{
        marginTop:'5%',
        width:'15%',
        backgroundColor:'#DAB671',
        borderTopLeftRadius:10,
        borderTopRightRadius:10,
        borderWidth:1,
    }

});

export default StyleEditCenter;
